import React from "react";

function Pokecard1(props) {
  return (
    <div>
      {props.name} {props.img} {props.type}
      <img src={`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/${props.id}.png`} alt="" />
    </div>
  );
}

export default Pokecard1;
